	fixed: {
		position: "fixed",
		zIndex: "1100"
	},
	container: {
		...container,
		minHeight: "50px",
		flex: "1",
		alignItems: "center",
		justifyContent: "space-between",
		display: "flex",
		flexWrap: "nowrap"
	},
	flex: {
		flex: 1
	},
	title: {
		fontFamily: `"Poppins", "Helvetica", "Arial", sans-serif`,
